import React from 'react';
import Related from './grafits';

const Grafits = (props) => {
  return (
    <div>
      <Related/>

      {

              new TradingView.widget(
              {
              "width": 980,
              "height": 610,
              "symbol": "NASDAQ:AAPL",
              "interval": "D",
              "timezone": "Etc/UTC",
              "theme": "Light",
              "style": "1",
              "locale": "en",
              "toolbar_bg": "#f1f3f6",
              "enable_publishing": false,
              "allow_symbol_change": true,
              "container_id": "tradingview_c8b6b"
              }
              )

      }
    </div>
  )
}
export default Grafits;
